SELECT ?portName WHERE {
  ?port a ns1:Port ;
        ns1:hasLatitude ?latitude .
  OPTIONAL { ?port rdfs:label ?portName . } 
}
ORDER BY DESC(?latitude)
LIMIT 1
```

